import React, { Component } from 'react';
import "./UserList.css";

class User extends Component {

    render() {
        return (
                <div className="user-list">
                    <span>{this.props.data.login}</span>
                    <span>{this.props.data.email}</span>
                    <span>{this.props.data.deleted}</span>
                    <span>{this.props.data.role}</span>
                    <span>Удалить</span>
                </div>
        );
    }
}

export default User;
